import React, { useState, useEffect } from "react";
import ResumeService from "../services/ResumeService";
import {Table } from "semantic-ui-react";

export default function ResumeList() {
  const [resumes, setResumes] = useState([]);

  useEffect(() => {
    let resumeService = new ResumeService();
    resumeService.getAllResume().then((result) => setResumes(result.data.data));
  }, []);

  return (
    <div>
      <Table>
        <Table.Header>
          <Table.Row>
            <Table.HeaderCell>Kişisel Bilgiler</Table.HeaderCell>
          </Table.Row>
        </Table.Header>

        <Table.Body vertical>
          {resumes.map((resume) => (
            <Table.Row key={resume.id}>
              <Table.Cell>{resume.candidateFirstName}</Table.Cell>
              <Table.Cell>{resume.candidateLastName}</Table.Cell>
              <Table.Cell>{resume.githubLink}</Table.Cell>
              <Table.Cell>{resume.linkedinLink}</Table.Cell>
              <Table.Cell>{resume.photo}</Table.Cell>
              <Table.Cell>{resume.description}</Table.Cell>
              <Table.Cell>{resume.createdDate}</Table.Cell>
              <Table.Cell>{resume.updatedDate}</Table.Cell>
            </Table.Row>
          ))}
        </Table.Body>
      </Table>
      <Table>
        <Table.Header>
          <Table.Row>
            <Table.HeaderCell>Eğitim</Table.HeaderCell>
          </Table.Row>
        </Table.Header>

        <Table.Body vertical>
          {resumes.map((resume) => (
            <Table.Row key={resume.id}>
              <Table.Cell>{resume.education.schoolName}</Table.Cell>
              <Table.Cell>{resume.schoolDepartment}</Table.Cell>
              <Table.Cell>{resume.startedDate}</Table.Cell>
              <Table.Cell>{resume.endedDate}</Table.Cell>
              <Table.Cell>{resume.createdDate}</Table.Cell>
              <Table.Cell>{resume.description}</Table.Cell>
            </Table.Row>
          ))}
        </Table.Body>
      </Table>
    </div>
  );
}
